import React from "react";
import "./App.css";
import Random from "./Random";
import Search from "./Search";
import About from "./About";
import Nav from "./Nav";

function App() {
  return (
    <div className="App">
      <Nav />
      <Random />
      <Search />
      <About />
    </div>
  );
}

export default App;
